        <Image
          src="https://react.semantic-ui.com/images/wireframe/paragraph.png"
          style={{ marginBottom: 10 }}
        />
        <Image
          src="https://react.semantic-ui.com/images/wireframe/paragraph.png"
          style={{ marginBottom: 10 }}
        />
        <Image src="https://react.semantic-ui.com/images/wireframe/paragraph.png" />
      </Modal.Description>
    </Modal.Content>
  );
};

export default RepositoryDetailsModal;
